script: |
  super -f text -I q9662.spq | sort > q9662.out

inputs:
  - name: q9662.spq
    data: |
      SELECT DISTINCT + col2 AS col0 FROM tab0 (FORMAT parquet) WHERE - + col0 NOT BETWEEN + - 97 * - col2 - - ( + + 62 ) AND NULL;
  - name: tab0

outputs:
  - name: q9662.out
    data: |
      10
      47
      99
